Components.ModelsTableCellEditToggle.description:
Component for cells used as toggle for edit-mode.

Properties and event-handlers from [models-table/cell](Components.ModelsTableCell.html) are bound here

Usage example:

```hbs
<ModelsTable
  @data={{data}}
  @columns={{columns}}
  @columnComponents={{hash
    editRow=(component
      "models-table/cell-edit-toggle"
      saveRowAction=(action "onSaveRow")
      cancelRowAction=(action "onCancelRow")
  )}}
/>
```

```js
import Controller from '@ember/controller';
import {action} from '@ember/object';

export default class InLineEditController extends Controller {

  data = [];

  columns = [
    {propertyName: 'firstName'},
    {propertyName: 'lastName'},
    {
      title: 'Edit',
      component: 'editRow',
      editable: false // <--- IMPORTANT
    }
  ];

  @action
  onSaveRow(param) {
    return param.record.save();
  }

  @action
  onCancelRow({record}) {
    record.rollbackAttributes();
    return true;
  }
}
```

Components.ModelsTableCell.description:
Table cell used within [models-table/table-row](Components.ModelsTableTableRow.html).

Cell types:

* Text. Shows some property value
* Route link with record id
* Route link with record property value
* Custom component

See properties [routeName](Utils.ModelsTableColumn.html#property_routeName), [propertyName](Utils.ModelsTableColumn.html#property_propertyName), [component](Utils.ModelsTableColumn.html#property_component) for ModelsTableColumn.

Usage example:

```hbs
<ModelsTable @data={{data}} @columns={{columns}} as |MT|>
  <MT.Table as |Table|>
    <Table.Body as |Body|>
      {{#each MT.visibleContent as |record index|}}
        <Body.Row @record={{record}} @index={{index}} as |Row|>
          {{#each MT.visibleProcessedColumns as |column|}}
            <Row.Cell @column={{column}} @index={{index}} as |Cell|/>
              {{#if Cell.componentToRender}}
                {{component Cell.componentToRender record=Cell.record column=column index=index}}
              {{/if}}
              {{! ... }}
            </Row.Cell>
          {{/each}}
        </Body.Row>
      {{/each}}
      {{! ... }}
    </Table.Header>
    {{! ... }}
  </MT.Table>
  {{! .... }}
</ModelsTable>
```

Components.ModelsTableColumnsDropdown.description:
Dropdown with list of table's columns used within [models-table](Components.ModelsTable.html).

It allows to toggle visibility for column sets or single column.

Columns that should not be hidden must have property [mayBeHidden](Utils.ModelsTableColumn.html#property_mayBeHidden) set to `false`.

Usage example:

```hbs
<ModelsTable @data={{data}} @columns={{columns}} as |MT|>
  <MT.ColumnsDropdown />
  {{! .... }}
</ModelsTable>
```

Block usage example:

```hbs
<ModelsTable @data={{data}} @columns={{columns}} as |MT|>
  <MT.ColumnsDropdown as |CD|>
    {{#if MT.columnDropdownOptions.showAll}}
      <button {{action MT.showAllColumns}}>Show all</button>
    {{/if}}
    {{#if MT.columnDropdownOptions.hideAll}}
      <button {{action MT.hideAllColumns}}>Hide all</button>
    {{/if}}
    {{#if MT.columnDropdownOptions.restoreDefaults}}
      <button {{action MT.restoreDefaultVisibility}}>Restore default visibility</button>
    {{/if}}
    {{#each MT.columnDropdownOptions.columnSets as |columnSet|}}
      <button {{action MT.toggleColumnSetVisibility columnSet}}>{{columnSet.label}}</button>
    {{/each}}
    {{#each MT.processedColumns as |column|}}
      {{#if column.mayBeHidden}}
        <button {{action MT.toggleHidden column}}>
          <i class={{if column.toggleColumnVisibility MT.themeInstance.columnVisibleIcon MT.themeInstance.columnHiddenIcon}}></i>
          {{column.title}}
        </button>
      {{/if}}
    {{/each}}
  </MT.ColumnsDropdown>
  {{! .... }}
</ModelsTable>
```

