Components.ModelsTableGroupedHeader.description:
Table header item used within [models-table/table-header](Components.ModelsTableTableHeader.html).

Each `grouped-header` should represent one item from [ModelsTable.groupedHeaders](Components.ModelsTable.html#property_groupedHeaders).

Usage example:

```js
const groupedHeaders = [
  [{title: 'BigTitle', colspan: 5}],
  [{title: 'SubTitle1', colspan: 2}, {title: 'SubTitle2', colspan: 3}]
];
```

```hbs
<ModelsTable
  @columns={{columns}}
  @data={{data}} as |MT|>
  <MT.Table as |Table|>
    <Table.Header as |Header|>
      {{#each groupedHeaders as |groupedHeader|}}
        <Header.GroupedHeader @groupedHeader={{groupedHeader}} as |GroupedHeader|>
          {{#each GroupedHeader.groupedHeader as |cell|}}
            <th colspan={{cell.colspan}} rowspan={{cell.rowspan}}>{{cell.title}}</th>
          {{/each}}
        </Header.GroupedHeader>
      {{/each}}
    </Table.Header>
  </MT.Table>
</ModelsTable>
```

Components.ModelsTableNoData.description:
Table row shown when no data provided to the ModelsTable. Component used within [models-table/table-body](Components.ModelsTableTableBody.html).

This component is a table-row with a single cell. This cell has a `colspan` equal to the shown columns count.

Usage example:

```hbs
<ModelsTable @data={{data}} @columns={{columns}} as |MT|>
  <MT.Table as |Table|>
    <Table.Body as |Body|>
      {{#if Body.visibleContent.length}}
        {{! ... }}
      {{else}}
        <Body.NoData />
      {{/if}}
    </Table.Body>
    {{! ... }}
  </MT.Table>
  {{! .... }}
</ModelsTable>
```

Usage with a block context:

```hbs
<ModelsTable @data={{data}} @columns={{columns}} as |MT|>
  <MT.Table as |Table|>
    <Table.Body as |Body|>
      {{#if Body.visibleContent.length}}
        {{! ... }}
      {{else}}
        <Body.NoData as |ND|>
          Any message here
        </Body.NoData>
      {{/if}}
    </table.Body>
    {{! ... }}
  </MT.Table>
  {{! .... }}
</ModelsTable>
```

Components.ModelsTableRowExpand.description:
Extra row with additional information for original row. Component used within [models-table/table-body](Components.ModelsTableTableBody.html).

Row expand is a table-row with a single cell. This cell has a `colspan` equal to the shown columns count. You should provide an [ModelsTable.expandedRowComponent](Components.ModelsTable.html#property_expandedRowComponent). It will be rendered inside ModelsTableRowExpand.

Usage example:

```hbs
<ModelsTable @data={{data}} @columns={{columns}} as |MT|>
  <MT.Table as |Table|>
    <Table.Body as |Body|>
      {{#each MT.visibleContent as |record index|}}
        <Body.Row @record={{record}} @index={{index}} />
        {{#if (exists-in MT.expandedItems record)}}
          <Body.RowExpand @record={{record}} @index={{index}} />
        {{/if}}
      {{/each}}
    </Table.Body>
    {{! ... }}
  </MT.Table>
  {{! .... }}
</ModelsTable>
```

